import React from "react";

function Contact() {
  return (
    <div id="contact">
      <h3>Contact Information</h3>
      <p>nevinada.cakmak@mail.utoronto.ca</p>
      <p>
        <a
          href="https://www.linkedin.com/in/nevin-ada-cakmak/"
          target="_blank"
          rel="noopener noreferrer"
        >
          LinkedIn
        </a>
      </p>
    </div>
  );
}

export default Contact;
